        "Tip: Get a feel for agents with our quick <a href=\"https://docs.n8n.io/advanced-ai/intro-tutorial/\" target=\"_blank\">tutorial</a> or see an <a href=\"/templates/1954\" target=\"_blank\">example</a> of how this node works": "提示：通过我们的快速<a href=\"https://docs.n8n.io/advanced-ai/intro-tutorial/\" target=\"_blank\">教程</a>体验代理，或查看此节点的<a href=\"/templates/1954\" target=\"_blank\">示例</a>",
        "This node is using Agent that has been deprecated. Please switch to using 'Tools Agent' instead.": "此节点使用的代理已过时。请改用“工具代理”。",
        "Describes tools in the system prompt and parses JSON responses for tool calls. More flexible but potentially less reliable than the Tools Agent. Suitable for simpler interactions or with models not supporting structured schemas.": "在系统提示中描述工具，并解析用于工具调用的JSON响应。比工具代理更灵活，但可能不够可靠。适用于较简单交互或不支持结构化方案的模型。",
        "Leverages OpenAI's function calling capabilities to precisely select and execute tools. Excellent for tasks requiring structured outputs when working with OpenAI models.": "利用OpenAI的函数调用功能，精确选择并执行工具。非常适合需要结构化输出的任务，尤其在使用OpenAI模型时。",
        "Creates a high-level plan for complex tasks and then executes each step. Suitable for multi-stage problems or when a strategic approach is needed.": "为复杂任务创建高层计划，然后执行每个步骤。适用于多阶段问题或需要战略性方法的场景。",
        "Combines reasoning and action in an iterative process. Effective for tasks that require careful analysis and step-by-step problem-solving.": "将推理与行动结合的迭代过程。适合需要仔细分析和逐步解决的任务。",
        "Specializes in interacting with SQL databases. Ideal for data analysis tasks, generating queries, or extracting insights from structured data.": "专门用于与SQL数据库交互。适合数据分析、生成查询或从结构化数据中提取洞见。",
