        "Controls the randomness of the generated text. Lower values make the output more focused and deterministic, while higher values make it more diverse and random.": "控制生成文本的随机性。较低的值使输出更集中和确定，较高的值使输出更丰富且随机。",
        "Limits the number of highest probability vocabulary tokens to consider at each step. A higher value increases diversity but may reduce coherence. Set to -1 to disable.": "限制每步考虑的最高概率词汇令牌数量。较高值增加多样性但可能降低连贯性。设为 -1 以禁用此功能。",
        "Chooses from the smallest possible set of tokens whose cumulative probability exceeds the probability top_p. Helps generate more human-like text by reducing repetitions.": "从累计概率超过 top_p 的最小令牌集合中选择，有助于通过减少重复生成更自然的人类文本。",
        "Adjusts the penalty for tokens that have already appeared in the generated text. Higher values discourage repetition.": "调整对已在生成文本中出现令牌的惩罚。较高值减少重复。",
